import * as React from 'react';
import { TotalData } from './Sex';
import { Bar } from 'react-chartjs-2';

const Dhb: React.FunctionComponent<TotalData> = ({ totalData }) => {
  const areas = Array.from(new Set(totalData.map((item) => item.dhb)));

  var myArray: { area: string | undefined; number: number }[] = [];
  areas.forEach((area, index) => {
    const mapped = totalData.map((item) => item.dhb === area);
    console.log(mapped.length);
    myArray.push({
      area: area,
      number: mapped.length,
    });
  });

  console.log(myArray);

  return <Bar data={totalData} />;
};

export default Dhb;
